import React from 'react';
import FilteredBlogs from './FilteredBlogs';

const Tech = () => {
  return (
    <div className="home">
      <h1 style={{ textAlign: 'center' }}> Tech and Games</h1>
      <FilteredBlogs category="tech" />
    </div>
  );
};

export default Tech;
